### Writing a First Person Controller Script in GDscript

To create a first person controller script in Godot Engine 3.x, follow these steps:

1. **Create a new script**:
   - Right-click in the project's `res://` folder and select `New > Script`.
   - Name the script `FirstPersonController.gd` and select `GDScript` as the language.

2. **Add the script to a node**:
   - Create a new node (e.g., `Player`) and add the `FirstPersonController` script to it.

3. **Implement the script**:
   - **Initialize variables**:
     ```gdscript
     var move_speed = 200.0
     var turn_speed = 200.0
     var jump_power = 200.0
     var is_jumping = false
     var is_falling = false
     var is_in_air = false
     var is_crouching = false
     var crouch_height = 0.5
     var is_sprinting = false
     var sprint_speed = 400.0
     var sprint_cooldown = 0.0
     var sprint_cooldown_time = 0.5
     var sprint_cooldown_timer = 0.0
     ```

   - **Define methods**:
     ```gdscript
     func _input(input: Input):
         if input.is_action_pressed("ui_action_cancel"):
             is_sprinting = false
             sprint_cooldown_timer = sprint_cooldown_time

         if input.is_action_pressed("ui_action_jump"):
             if !is_in_air and !is_crouching:
                 is_jumping = true
                 is_falling = false
                 is_in_air = true

         if input.is_action_pressed("ui_action_sprint"):
             sprint_cooldown_timer = sprint_cooldown_time
             is_sprinting = true
             move_speed = sprint_speed

         if input.is_action_released("ui_action_sprint"):
             sprint_cooldown_timer = sprint_cooldown_time
             is_sprinting = false
             move_speed = 200.0

         if input.is_action_released("ui_action_jump"):
             is_jumping = false
             is_falling = true
             is_in_air = true

         if input.is_action_released("ui_action_crouch"):
             is_crouching = false
             _set_global_position(Vector3(x, y + crouch_height, z))

         if input.is_action_pressed("ui_action_crouch"):
             is_crouching = true
             _set_global_position(Vector3(x, y - crouch_height, z))

         if input.is_action_released("ui_action_move_left"):
             turn_speed = 0.0

         if input.is_action_released("ui_action_move_right"):
             turn_speed = 0.0

         if input.is_action_pressed("ui_action_move_left"):
             turn_speed = -turn_speed

